import React,{useEffect, useState} from 'react'
import { Button, Form, Select,Input } from 'antd';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
const { Option } = Select;
const layout = {
  labelCol: {
    span: 8,
  },
  wrapperCol: {
    span: 16,
  },
};
const tailLayout = {
  wrapperCol: {
    offset: 8,
    span: 16,
  },
};
export const PartIssue = ({data,uniqueData,toolCode,handleCancel}) => {
   const[postData,setPostData]=useState([]);
   const navigate = useNavigate()
   const [form] = Form.useForm();
   const onToolChange = (value) => {
    console.log(value)
  };
  useEffect(()=>{
    axios.get('http://localhost:5000/api/tool_table').then(i=>console.log(i))
    // setPostData(data.filter(i=>i.tool_code==toolCode))
      console.log(data,'data data data')
    // console.log(postData,'kkkkkkkkkkkkkkkkkkkkkk')
  },[data])
  const onFinish = async() => {
    console.log(postData,'onFinish')
    let datas ={
      id: postData[0].id,
      value: postData[0].value-1,        
    }
    try {
      await axios.put('http://localhost:5000/api/issueTool/', datas)
    } catch (error) {
      console.log(error)
    }
    handleCancel()
    navigate("/toolRecord")
  };
    const onReset = () => {
      form.resetFields();
    };
    const onFill = () => {
      form.setFieldsValue({
        note: 'Hello world!',
        gender: 'male',
      });
    };


  return (
   <>
   
   <Form
{...layout}
form={form}
name="control-hooks"
onFinish={onFinish}
style={{ maxWidth: 600 }}
>

<Form.Item name="serialNumber" label="Serial Number" rules={[{ required: true }]}>
  <Input/>
</Form.Item>
<Form.Item name="cardNumber" label="Card Number" rules={[{ required: true }]}>
  <Input/>
</Form.Item>
<Form.Item name="tool_code" label="Select Tool Code" rules={[{ required: true }]}>
  <Input/>
</Form.Item>
<Form.Item name="tool" label="Selet Tools" rules={[{ required: true }]}>
  <Select
    onChange={onToolChange}
    allowClear
  >
      <Option value="Trimmer">Trimmer</Option>
    <Option value="boobin_case">Boobin Case</Option>
    <Option value="scissor">Scissor</Option>
    <Option value="tape_machine">Tape Machine</Option>
    <Option value="tape_dispenser">Tape Dispenser</Option>
    <Option value="tag_gun">Tag Gun</Option>
    <Option value="metal_stick">Metal Stick</Option>
  </Select>
</Form.Item>
<Form.Item name="operator" label="Select Operator" rules={[{ required: true }]}>
  <Select
    // onChange={onDepartmentChange}
    allowClear
  >
    <Option value="usha_dixit">USHA DIXIT</Option>
    <Option value="sunil_kumar_viswas">SUNIL KUMAR VISHWAS</Option>
    <Option value="shobha">SHOBHA</Option>
    <Option value="sunita_shukla">SUNITA SHUKLA</Option>
    <Option value="meena_devi">MEENA DEVI</Option>
    <Option value="kunt_kaur">KUNT KAUR</Option>
    <Option value="rekha_dua">REKHA DUA</Option>
    <Option value="puja_devi">PUJA DEVI	</Option>
    <Option value="shyam_sunderi_devi">SHYAM SUNDARI DEVI</Option>
  </Select>
</Form.Item>
<Form.Item name="department" label="Select Department" rules={[{ required: true }]}>
  <Select
    // onChange={onDepartmentChange}
    allowClear
  >
    <Option value="sewing">Sewing</Option>
    <Option value="finishing">Finishing</Option>
    <Option value="packing">Packing</Option>
    <Option value="part_change">Part Change</Option>
    <Option value="smocking">Smocking</Option>
    <Option value="sampling">Sampling</Option>
  </Select>
</Form.Item>
<Form.Item name="remark" label="Remark" rules={[{ required: true }]}>
  <Input/>
</Form.Item>

<Form.Item name="status" label="Status" rules={[{ required: true }]}>
  <Input/>
</Form.Item>

<Form.Item {...tailLayout}>
  <Button type="primary" htmlType="submit">
    Submit
  </Button>
</Form.Item>
</Form> 
   </>
  )
}
